import React from "react";
import notes from "../notes";

function Note(props) {
  return (
    <div className="note">
    {notes.map(newEntry =>
        <NewNote 
          key = {newEntry.id}
          title = {newEntry.title}
          content = {newEntry.content}
        />)}

      <h1>{props.Title}</h1>
      <p>{props.Content}</p>
    </div>
  );
}

export default Note;
